Every tree and grass here is a fractal generated by the method of iterative functional systems (IFS). Fractal detail depends on the size of the picture. Higher screen resolution => more beautiful fractal. Therefore, the resolution of the final image must be preferably bigger than 2000 pixels (e.g., 3000x3000 or 4000x4000 pixels). So after loading the standard size preview, press the key:

- "s" to save the image at current resolution;
- "2" to save the image at 2000x2000px resolution;
- "3" to save the image at 3000x3000px resolution;
- "4" to save the image at 4000x4000px resolution;
- "5" to save the image at 5000x5000px resolution;
- "6" to save the image at 6000x6000px resolution.

After pressing the key, wait patiently while the algorithm draws your forest.

12.2021

